import { Mesh } from 'three';
import { TextureLoader } from 'three';
import { useRef, useEffect, useState, RefObject } from 'react';
import useAudioData from "./Hooks/useAudioData";
import { useLoader, extend } from '@react-three/fiber';
import TiltShiftMaterial from "../Shaders/TiltShiftMaterial";


const base64Texture2 = "data:image/jpeg;base64,";

// to notify to three-js (it will not work without)
extend({ TiltShiftMaterial })

interface PlaneProps {
  base64Texture: string;
  width: number;
  height: number;
}

function Plane({base64Texture, width, height}: PlaneProps) {
	const [texture] = useLoader(TextureLoader, [
    base64Texture
  ]);

	return (
		<mesh
	      position={[0,0,0]}
	    >
	      <planeGeometry args={[width, height]} />
	      
	      <tiltShiftMaterial
	        uTexture={texture}
	        uEnable={true}
	        uSaturation={0.2}
          uBlur={1}
          uTopY={0.7}
          uBottomY={0.05}
          uIntensity={0.1}
	      />
	      </mesh>
	)
} 
export default Plane;